import React, { Component } from 'react';
import PropType from 'prop-types';

const Header = props => {
    const { branding } = props;
    return (
        <div>
            <h1>{branding}</h1>
        </div>

    );
}

Header.defaultProps = {
    branding: "My App"
}

Header.propType = {
    branding: PropType.string.isRequired
}
export default Header;
